import React, { useState } from 'react'
import ListItem from './ListItem'

const List = ({ setCurrentBook, bookList }) => {
    //const [books, setBooks] = useState(bookList)

    return (
        <div className="list">
            <ul>
                {bookList.map((b) => (
                    <ListItem book={b} setCurrentBook={setCurrentBook} />
                ))}
            </ul>
        </div>
    )
}

export default List
